import { Box } from "@mui/material";
import React from "react";
import Menu from "./components/Menu";
import İmageLogo from "../../../assets/image/logoTs.jpg";
import { stlyes as S } from "./Header.module.css";

const Sidebar = () => {
  return (
    <Box
      sx={{
        width: "256px",
        height: "100vh",
        background: "red",
      }}
    >
      <div className="logo">
        <img className={S.logo} src={İmageLogo} alt="" /> Tatlı Sözlük
      </div>

      <Menu />
    </Box>
  );
};

export default Sidebar;
